import { Component } from '@angular/core';
import { AgGridAngular } from 'ag-grid-angular';
import 'ag-grid-community/styles/ag-grid.css';
import "ag-grid-community/styles/ag-theme-quartz.css";
import './styles.css';
import { ColDef, ColGroupDef, GridApi, GridOptions, GridReadyEvent, RowClassRules, createGrid } from 'ag-grid-community';
import { getData } from './data';



@Component({
    selector: 'my-app',
    standalone: true,
    imports: [AgGridAngular],
    template: `<div class="example-wrapper">
    <div style="margin-bottom: 5px">
        <button (click)="setData()">Update Data</button>
    </div>

    <ag-grid-angular

    style="width: 100%; height: 100%;"
    [rowData]="rowData"
    [columnDefs]="columnDefs"
    [rowClassRules]="rowClassRules"
    [class]="themeClass"
    (gridReady)="onGridReady($event)"
     />
</div>
`
})

export class AppComponent {
    private gridApi!: GridApi;


    public rowData: any[] | null = getData();
public columnDefs: ColDef[] = [
    { headerName: 'Employee', field: 'employee' },
    { headerName: 'Number Sick Days', field: 'sickDays', editable: true },
];
public rowClassRules: RowClassRules = {
    // row style function
    'sick-days-warning': (params) => {
        var numSickDays = params.data.sickDays;
        return numSickDays > 5 && numSickDays <= 7;
    },
    // row style expression
    'sick-days-breach': 'data.sickDays >= 8',
};
public themeClass: string = /** DARK MODE START **/document.documentElement?.dataset.defaultTheme || 'ag-theme-quartz'/** DARK MODE END **/;


    setData() {
    this.gridApi.forEachNode(function (rowNode) {
        var newData = {
            employee: rowNode.data.employee,
            sickDays: randomInt(),
        };
        rowNode.setData(newData);
    });
}

onGridReady(params: GridReadyEvent) {

            this.gridApi = params.api;
        }
}



function randomInt() {
    return Math.floor(Math.random() * 10);
}

